import React, { Component } from "react";
import "./counter.css";
class Counter extends Component {
  render() {
    return (
      <div>
        <h1>CINEPHILE</h1>
        <input
          type="text"
          id="myInput"
          onkeyup="myFunction()"
          placeholder="Enter movie Name here"
        ></input>
      </div>
    );
  }
}

export default Counter;
